import {Card} from "../component/Component";
function Home(){
    return (
        <div className="w-full h-screen">
            <div className={`grid grid-cols-2 lg:grid-cols-4 sm:grid-cols-3 justify-center`}>
                <Card bgColor="green-500" text="white" title="Welcome to UKS Dashboard" class="w-full h-full"></Card>
                <Card bgColor="blue-500" text="white" title="Data Siswa" class="w-full h-full"></Card>
                <Card bgColor="yellow-500" text="white" title="Data Kesehatan" class="w-full h-full"></Card>
                <Card bgColor="red-500" text="white" title="Laporan UKS" class="w-full h-full"></Card>
            </div>
        </div>
    );
}
export default Home;
